import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, BrowserRouter } from 'react-router-dom';

import Navbar from './components/Navbar/navbar';
import Login from './Pages/login';
import Product from './Pages/product';
import ShopCategory from './Pages/shopCategory';
import Shop from './Pages/shop';
import Cart from './Pages/cart';
import Footer from './components/Footer/Footer';
import men_banner from './components/Assets/men_banner.jpeg'
import women_banner from './components/Assets/women_banner.webp'
import kids_banner from './components/Assets/kids_banner.jpg'

const App = () => {
  return (
    <div>         <Navbar />
    <BrowserRouter>       
      <Router>

          <Link to='/' element={<Shop />} />
          <Link to='/mens' element={<ShopCategory banner={men_banner} category="mens" />} />
          <Link to='/womens' element={<ShopCategory banner={women_banner} category="womens" />} />
          <Link to='/kids' element={<ShopCategory banner={kids_banner} category="kids" />} />
          <Link to='/product' element={<Product />} />
          <Link to='/product/:productId' element={<Product />} />
          <Link to='/cart' element={<Cart />} />
          <Link to='/login' element={<Login />} />

        <Footer/>
      </Router>
    </BrowserRouter>
    </div>
  );
}

export default App;
